/**
 * 游대 DEX Configuration Switcher
 * Centralized config file to dynamically switch between supported DEXes
 * 游댃 Expandable: Add SushiSwap, QuickSwap, etc. here later
 */

export const dexConfig = {
  defaultDEX: "pancakeswap", // 九勇 Used as fallback/default
  supportedDEXs: {
    pancakeswap: {
      rpc: "https://bsc-dataseed.binance.org/", // 游리 BSC Node
      router: "0x10ED43C718714eb63d5aA57B78B54704E256024E" // 游 PancakeSwap Router
    },
    uniswap: {
      rpc: "https://mainnet.infura.io/v3/YOUR_INFURA_KEY", // 游댯 Ethereum Node
      router: "0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D" // 游붃 Uniswap V2 Router
    }
  }
};
